contract parent{ 
     uint internal sum; 

   function setValue() external { 
        uint a = 10;
        uint b = 20;
        sum = a + b;
    } 
} 

contract child is parent{ 

    function getValue(
    ) external view returns(uint) { 
        return sum; 
    } 
} 

contract caller {

    child cc = new child();  

    // Defining function to call
    // setValue and getValue functions
    function testInheritance(
    ) public returns (uint) { 
        cc.setValue(); 
        return cc.getValue(); 
    } 
}

